COMPLETE ENGINE CLEANING BRUSH KIT
Each brush is made from stiff bristle nylon that will not soften or melt when used in conjunction with most engine cleaning solvents. Each handle is made from heavy gauge twisted steel wire to minimize bending, and a convenient loop at the end of each brush provides easy hanging and storage. Contains nine (9) assorted brushes per kit. Brush diameters range from 1 4 " to 5".nbsp;
